
public class Ejercicio_String_Primitivo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String edad = "34";
		int n;
		n = Integer.parseInt(edad);
		double n2 = Double.parseDouble(edad);
		
		System.out.println("Entero " + n);
		System.out.println("Double " + n2);
	}

}
